import React from "react";
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import "./Header/slideshow.css";

const Slideshow = () => {
  const settings = {
    dots: true,
    Infinity: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScrool: 1,
    autoplay: true,
    autoplaySpeed: 2000,
  };
  return (
    <Slider {...settings}>
      <div>
        <div className="image-container">
          <img
            className="img-slide"
            src="./images/bonus.png"
            alt="Slika1"
            width={450}
          />
        </div>
        <div className="image-container">
          <img src="./images/free.png" alt="Slika2" width={450} />
        </div>
        <div className="image-container">
          <img src="./images/promo.png" alt="Slika3" width={450} />
        </div>
      </div>
    </Slider>
  );
};

export default Slideshow;
